addon.itemBindsCount = "85000"

-- simply override Auctionator's data
-- isBOP   = (bonding == 1); isQuest = (bonding == 4 or bonding == 5);
function Atr_GetBonding (itemID, vpstr)
	if (itemID == nil) then	return 0 end
	if (vpstr == nil) then vpstr = addon.itemBinds end

	local bonding = 0;		-- doesn't bind
	local x = itemID;

	if (x <= string.len (vpstr)) then
		local s = string.sub (vpstr, x, x);
		if (s ~= ".") then
			bonding = tonumber (s)
		end
	end

	return bonding;
end
